import React, {useEffect, useState} from 'react';
import {useAppDispatch, useAppSelector} from './redux/store';
import SignUp from "./pages/signUp";
import SignIn from "./pages/signIn";
import {Route, Routes} from "react-router-dom";
import {checkDarkMode} from "./utils/util";
import Header from "./layouts/header";

function App() {
  const [employerId, setEmployerId] = useState(0);
  const dispatch = useAppDispatch();
  const { loading, error, data } = useAppSelector(state => state.authSlice);

  useEffect(() => {

    checkDarkMode();
  }, [])

  return (
      <>
      <Header />
          <main className="w-full h-screen flex justify-center items-center dark:bg-[#1b1b1b]">
              <Routes>
                  <Route path="/" element={<SignIn />} />
                  <Route path="/signup" element={<SignUp />} />
              </Routes>
          </main>
      </>
  );
}

export default App;
